import React from 'react';

function HomeHeroSection() {
  return (
    <main className='home-hero-section'>
      <div className='home-hero-section__container'>
        <p className='home-hero-section__text'>
          <span home-hero-section__text-accent>Epoxidový svet</span>– váš
          sprievodca svetom epoxidovej živice! Nájdete tu užitočné články, tipy
          a praktické informácie o práci s epoxidom. Naučíte sa správne používať
          materiály, náradie a techniky na tvorbu jedinečných výrobkov. Objavte
          kúzlo epoxidu s nami!
        </p>
        <div className='home-hero-section__images'></div>
      </div>
    </main>
  );
}

export default HomeHeroSection;
